import React from 'react'
import { View, Text } from 'react-native'
import { StatusBar } from "react-native";

const NavBar = () => {
    return (
        <View>
            <Text style={{ color: 'white', flex: 1, marginTop: 20, backgroundColor: 'green' }}>Soy el Navbar</Text>
        </View>
    )
}

export default NavBar
